INSERT INTO `TB_PRODUTO` (`co_produto`, `no_produto`, `ds_descricao`, `nu_codigo`, `nu_codigo_interno`, `no_produto_url_amigavel`, `dt_cadastro`, `st_status`, `ds_caminho_video`, `ds_caminho_manual`, `co_unidade_venda`, `co_categoria`, `co_fabricante`, `co_imagem`) VALUES
(2, 'Condicionador De Ar Tipo Split Fit Ccs9f-R4', '<h1>Descri&ccedil;&atilde;o do Produto</h1>\r\n\r\n<p><strong>Com design clean, moderno e elegante, os Splits<br />\r\nAgratto combinam com qualquer ambiente.</strong></p>\r\n\r\n<p>Design pensado para se adequar &agrave;s necessidades, os Ares Split Agratto combinam com qualquer<br />\r\ncasa ou ambiente de trabalho. D&atilde;o um toque de modernidade enquanto geram conforto com uma climatiza&ccedil;&atilde;o perfeita.<br />\r\n<br />\r\nOp&ccedil;&otilde;es:&nbsp;<strong>APENAS FRIO ou QUENTE E FRIO</strong><br />\r\nCapacidades:&nbsp;<strong>9.000BTUs | 12.000BTUs | 18.000BTUs | 22.000BTUs* | 30.000BTUs*</strong><br />\r\n*Consulte disponibilidade.</p>', NULL, 4809, 'condicionador-de-ar-tipo-split-fit-ccs9f-r4', '2018-05-05 00:41:33', 'A', 'https://www.youtube.com/embed/gk609FlEWrM', 'http://www.agratto.com.br/fmanager/ventisolagratto/produtos/arquivo_manual33_1.pdf', 1, 6, 6, 11),
(3, 'Visa Master Cervejeira Bipartida 4 Portas P/22 Cxs', '<p>Utiliza&ccedil;&otilde;es Exposi&ccedil;&atilde;o de cervejas&nbsp;<br />\r\nRevestimento interno Galvanizado&nbsp;<br />\r\nRevestimento externo (frente) Inox&nbsp;<br />\r\nCores dispon&iacute;veis das laterais externas Vaccum forming Azul,Amarelo,Cinza,Preto,Vermelho<br />\r\nSistema de refrigera&ccedil;&atilde;o Ar For&ccedil;ado&nbsp;<br />\r\nTens&atilde;o (V)127V ou 220V<br />\r\nFrequ&ecirc;ncia (Hz)50Hz ou 60Hz<br />\r\nIsolamento 100% Poliuretano injetado&nbsp;<br />\r\nIlumina&ccedil;&atilde;o&nbsp;<br />\r\nControlador de temperatura Digital<br />\r\nPortas Cegas adesivadas&nbsp;<br />\r\nPrateleiras regul&aacute;veis 4&nbsp;<br />\r\nTesteira Adesivada<br />\r\nDimens&otilde;es (compr x prof x alt) 1540 x 790 x 2160<br />\r\nTemperatura (oC) -6&nbsp;, -4 e 0<br />\r\nSistema de Refrigera&ccedil;&atilde;o Ar For&ccedil;ado<br />\r\nCapacidade total (L) 1403<br />\r\nCapacidade &uacute;til/l&iacute;quida (L) 1114<br />\r\nConsumo (kwh/m&ecirc;s)** 286<br />\r\nConsumo (kw/h)** 0,53<br />\r\nCorrente (A) 3,5<br />\r\nG&aacute;s R-134A<br />\r\nPeso l&iacute;quido (Kg) 198<br />\r\nPeso bruto (Kg) 235<br />\r\nCapacidade &uacute;til de garrafas 600ml 528<br />\r\nCapacidade &uacute;til de garrafas 1 litro 384<br />\r\nCapacidade &uacute;til de latas 350ml 1344<br />\r\nCapacidade &uacute;til de latas 500ml 672</p>', NULL, 4341, 'visa-master-cervejeira-bipartida-4-portas-p-22-cxs', '2018-05-07 15:50:20', 'A', '', '', 1, 4, 9, 12),
(6, 'Cortador De Frios Automático Inox Anodizado', '<p>AXT 33i</p>\n\n<p>ESPECIFICA&Ccedil;&Otilde;ES<br />\nProdu&ccedil;&atilde;o m&eacute;dia: 40 semanas por minuto<br />\nComprimento: 665 mm&nbsp;<br />\nLargura: 670 mm&nbsp;<br />\nAltura: 645 mm<br />\nFaca: 330 mm<br />\nPeso: 39 kg<br />\nTens&atilde;o el&eacute;trica: 127/220 v\nPot&ecirc;ncia do motor: 0,5 cv&nbsp;<br />\nFrequ&ecirc;ncia: 50/60 Hz</p>', NULL, 33, 'cortador-de-frios-automatico-inox-anodizado', '2018-05-08 16:38:51', 'A', '', '', 1, 4, 1, 18),
