(17, 'Cilindro 390 CL-390 c/pe 220 v', '<p>&nbsp;</p>\r\n\r\n<p>Caracteristicas</p>\r\n\r\n<p>&nbsp;&nbsp; Os Cilindros da linha Gastromaq s&atilde;o equipados com escala graduada de 0,5 a 25 mm. Permitindo uma regulagem de lamina&ccedil;&atilde;o mais r&aacute;pida e precisa. Os mecanismos em movimento s&atilde;o montados em eixo de a&ccedil;o SAE1045, sobre rolamentos de primeira linha com dupla blindagem, lubrifica&shy;&ccedil;&atilde;o permanente e engrenagens de a&ccedil;o temperado. Para maior seguran&ccedil;a do operador, contam&nbsp;&nbsp; com&nbsp;&nbsp; o&nbsp;&nbsp; Cilindro&nbsp;&nbsp; Seguran&ccedil;a localizado, aproximadamente no meio do funil. O Cilindro encontra-se a uma&nbsp;&nbsp; altura que permite a entrada da massa por&eacute;m impede a aproxima&ccedil;&atilde;o das m&atilde;os do usu&aacute;rio at&eacute; os cilindros laminadores devido a dist&acirc;ncia ideal em que o mesmo est&aacute; montado. Acompanha caixa de farinha (trigo) localizado na lateral direita da maquina.A grade de prote&ccedil;&atilde;o impede o acesso das m&atilde;os do operador junto aos cilindros laminadores, a n&atilde;o ser que haja neces&shy;sidade de iterven&ccedil;&atilde;o do mesmo. Situa&ccedil;&atilde;o em que se pode bascular a referida grade fazendo com que o micro interruptor deixe de ser pressionado, o que corta o fornecimento de energia el&eacute;trica para o motor do equipamento, bloqueado todos os movimentos do cilindro.</p>\r\n\r\n<p>Especifica&ccedil;&otilde;es T&eacute;cnicas</p>\r\n\r\n<p>CAPACIDADE:&nbsp; 4 KG<br />\r\nPOT&Ecirc;NCIA: 1,0 CV<br />\r\nVELOCIDADE: 80 rpm<br />\r\nCONSUMO:0,75 Kw/h<br />\r\nPESO: 78 Kg<br />\r\nDIMENS&Otilde;ES (alt x larg x comp): 1240 x 780 x 860 mm<br />\r\nDI&Acirc;METRO DOS ROLOS: 70 mm</p>', NULL, 4954, 'cilindro-390-cl-390-c-pe-220-v', '2018-05-22 10:42:40', 'A', '', '', 1, 6, 11, 36),
(18, 'Batedeira B P-12 220v Gastromaq', '<ul>\r\n	<li>\r\n	<h3>Caracter&iacute;sticas</h3>\r\n\r\n	<p>Modelo: BP12<br />\r\n	EQUIPAMENTO ATENDE NR12<br />\r\n	<a href=\"https://www.shoppingdaspadarias.com.br/pesquisa/?p=Batedeira+Planet%C3%A1ria\" target=\"_blank\">Batedeira Planet&aacute;ria</a>&nbsp;destinada a misturar e bater massas m&eacute;dias para, biscoitos, e batidos leves como p&atilde;o de I&oacute;, merengues, cremes, glac&ecirc;s, e outros preparos especiais;<br />\r\n	Batedores em alum&iacute;nio especiais pra cada fun&ccedil;&atilde;o (globo, raquete e espiral);<br />\r\n	Velocidade em seis est&aacute;gios;<br />\r\n	Corpo em chapa de a&ccedil;o SAE 1020 com pintura ep&oacute;xi;<br />\r\n	Cuba em a&ccedil;o inoxid&aacute;vel;<br />\r\n	Engrenagens em a&ccedil;o especial temperado;<br />\r\n	Rolamentos blindados;<br />\r\n	Sistema de varia&ccedil;&atilde;o de velocidade por meio de polia variadora;<br />\r\n	Troca de velocidade por meio de alavanca externa segura e pr&aacute;tica, dispositivo de seguran&ccedil;a no acesso &agrave; cuba.</p>\r\n	</li>\r\n	<li>\r\n	<h3>Especifica&ccedil;&otilde;es T&eacute;cnicas</h3>\r\n\r\n	<p>Modelo: BP12<br />\r\n	Capacidade: 12 L<br />\r\n	Consumo m&eacute;dio: 0,25 kw/h<br />\r\n	Pot&ecirc;ncia: 1/3 cv&nbsp;<br />\r\n	Freq&uuml;&ecirc;ncia: 50/60 Hz<br />\r\n	Tens&atilde;o: 220V<br />\r\n	Altura: 560 mm<br />\r\n	Frente: 315 mm<br />\r\n	Profundidade: 695 mm<br />\r\n	Peso l&iacute;quido: 42 kg<br />\r\n	Peso bruto: 52 kg<br />\r\n	Garantia: 6 meses&nbsp;<br />\r\n	Altura c/ embalagem: 660 mm<br />\r\n	Frente c/ embalagem: 415 mm<br />\r\n	Profundidade c/ embalagem: 795 mm</p>\r\n	</li>\r\n</ul>', NULL, 3268, 'batedeira-b-p-12-220v-gastromaq', '2018-05-22 14:17:07', 'A', '', '', 1, 6, 11, 37),
