(25, 'Balança Elgin 15kg com bateria', '<p>Balan&ccedil;a Elgin ideal para com&eacute;rcios como restaurantes, docerias, sorveterias, padarias ou ind&uacute;strias. A balan&ccedil;a pesa e calcula de maneira r&aacute;pida e pode ser usada com bateria. Tem op&ccedil;&atilde;o &quot;Tara&quot; e uso em pr&eacute;-empacotamento com a fun&ccedil;&atilde;o constante (Cons).</p>', NULL, 185, 'balanca-elgin-15kg-com-bateria', '2018-06-06 09:34:44', 'A', '', '', 1, 8, 37, 77),
(26, 'Balança Toledo Prix 4 Uno Web', '<p>A Prix 4 Uno Foi Projetada Para Utilizar Etiquetas Econ&ocirc;micas E Para Proporcionar Menos Gastos Com Suprimentos E Maior Vantagem Competitiva Na Forma&ccedil;&atilde;o Do Custo Do Item A Ser Comercializado.&nbsp;A Solu&ccedil;&atilde;o No Tamanho Certo Para O Seu Negocio. Maior Economia Na Rotulagem Das Vendas Por Peso Ou Qualidade.&nbsp;</p>\r\n\r\n<p>Caracter&iacute;sticas E Benef&iacute;cios<br />\r\nNa Medida Certa Para Atender As Necessidades Do Pequeno E M&eacute;dio Com&eacute;rcio.</p>\r\n\r\n<p>Itens<br />\r\n1.000 Itens<br />\r\nDescritivo De 1 Linha Com 25 Caracteres<br />\r\nCodifica&ccedil;&atilde;o E Precifica&ccedil;&atilde;o Com At&eacute; 6 D&iacute;gitos<br />\r\nData E Hora Da Embalagem<br />\r\nValidade De 0 A 990 Dias<br />\r\nLote De At&eacute; 12 Caracteres Alfanum&eacute;ricos<br />\r\nInforma&ccedil;&otilde;es Extras<br />\r\nAt&eacute; 1.000 (At&eacute; 5 Linhas De 56 Caracteres Cada)<br />\r\nInforma&ccedil;&atilde;o Nutricional<br />\r\nAt&eacute; 1.000 Tabelas (Rdc&rsquo;S N&deg;359 E N&deg;360 Da Anvisa)<br />\r\nRecursos Gr&aacute;ficos<br />\r\nComplementam A Identifica&ccedil;&atilde;o Dos Itens E Permitem Personalizar As Etiquetas Impressas Com A Logomarca Ou Nome Do Estabelecimento. Prev&ecirc; 3 (Tr&ecirc;s) Tipos De Imagens:</p>\r\n\r\n<p>Imagens De Item Para Associa&ccedil;&atilde;o Direta Aos Itens.<br />\r\nImagens De Cabe&ccedil;alho E De Rodap&eacute;.</p>\r\n\r\n<p>Cadastro Local Ou Via Computador<br />\r\nCom A Prix 4 Uno Voc&ecirc; Poder&aacute; Cadastrar Produtos Na Pr&oacute;pria Balan&ccedil;a Ou Via Computador Quando Ligada Em Rede, Atendendo As Necessidades De Estabelecimentos Que Comercializem Uma Quantidade Maior De Itens Ou Que Necessitem Um Gerenciamento Mais Apurado Das Transa&ccedil;&otilde;es Efetuadas Pelas Balan&ccedil;as.</p>\r\n\r\n<p>Fonte Multivoltagem<br />\r\nPermite Funcionamento Autom&aacute;tico Entre 93,5 A 260,0 Vca, Dispensando O Uso De Estabilizadores De Tens&atilde;o E Chave De Comuta&ccedil;&atilde;o De Energia.&nbsp;<br />\r\nEvita A Queima Da Sua Prix 4 Uno Protegendo-A Contra Varia&ccedil;&otilde;es E Sobrecargas Na Rede El&eacute;trica.</p>\r\n\r\n<p>Pesagem At&eacute; 15 Kg Com Dupla Faixa De Pesagem<br />\r\nSistema De Pesagem Com Dupla Faixa De Pesagem Permite Que A Mesma Balan&ccedil;a Atenda &Agrave; Venda De Produtos De Alto Valor Em Pequenas Quantidades, Como Produtos De Baixo Valor Em Grandes Quantidades, Conforme Sua Necessidade.</p>\r\n\r\n<p>Base Em Pl&aacute;stico Abs<br />\r\nAl&eacute;m De Apresentar Alta Durabilidade E Facilidade Na Higieniza&ccedil;&atilde;o, Elimina Definitivamente Problemas De Oxida&ccedil;&atilde;o, Al&eacute;m De Oferecer Maior Leveza &Agrave; Prix 4 Uno.</p>\r\n\r\n<p>Realiza Todos Os Tipos De Transa&ccedil;&atilde;o<br />\r\nA Prix 4 Uno Viabiliza A Comercializa&ccedil;&atilde;o De Qualquer Item Da Loja, Dispensando Outros Equipamentos Para A Rotulagem E Atendendo As Exig&ecirc;ncias Legais.</p>\r\n\r\n<p>Venda Por Peso Ou Por Unidade<br />\r\nMediante Cadastro Pr&eacute;vio, Permite Comercializar Itens Por Peso Ou Por Unidade. Na Venda Por Unidade, &Eacute; Poss&iacute;vel Definir Previamente A Quantidade De Etiquetas A Serem Impressas, Agilizando A Precifica&ccedil;&atilde;o De Lotes De Itens.</p>\r\n\r\n<p>Venda De Drenados<br />\r\nConforme Portaria Inmetro N&deg; 157, De 19 De Agosto De 2002, Como &Eacute; O Caso Das Azeitonas, Picles, Entre Outros. &Eacute; Poss&iacute;vel Descontar A Embalagem E Qualquer L&iacute;quido Ou Solu&ccedil;&atilde;o Conservante Do Peso Do Produto Para Declara&ccedil;&atilde;o Na Rotulagem Como Conte&uacute;do L&iacute;quido.</p>\r\n\r\n<p>Venda De Glaciados<br />\r\nFornece A Quantidade De Glaciamento E O Peso L&iacute;quido Do Item, Ou Seja, Descontando O Peso Do Gelo, Estar&aacute; Presente A Quantidade Exata De Peixe Que Est&aacute; Sendo Comercializada E Seu Real Valor. Atende Completamente A Norma T&eacute;cnica N&deg; 19/2009 Do Minist&eacute;rio Da Justi&ccedil;a.</p>\r\n\r\n<p>Acumulador De Vendas (Geral E Por Item)<br />\r\nA Prix 4 Uno Oferece Informa&ccedil;&otilde;es Detalhadas Do Peso, Quantidade, Pre&ccedil;o E N&uacute;mero De Transa&ccedil;&otilde;es Efetuadas Por Item Ou Geral (Todos Os Itens), De Forma Simples E R&aacute;pida, Dando Seguran&ccedil;a E Praticidade Ao Seu Neg&oacute;cio.</p>\r\n\r\n<p>48 Teclas R&aacute;pidas E Acesso A At&eacute; 144 Itens<br />\r\nPermite Acessar Rapidamente Os Itens Mais Vendidos Por Teclas Personalizadas, Identificadas Por Imagens Ou Textos, Dispensando A Digita&ccedil;&atilde;o Do C&oacute;digo. Permite Conjugar At&eacute; 3 Itens Numa Mesma Tecla.</p>', NULL, 1912, 'balanca-toledo-prix-4-uno-web', '2018-06-06 09:38:27', 'A', '', '', 1, 8, 35, 78),
(27, 'Balcão Refrigerado Boreal 220v Inox BBRC175 2 placas', '<h2><strong>Caracter&iacute;sticas</strong></h2>\r\n\r\n<p>Estrutural:</p>\r\n\r\n<ul>\r\n	<li>Laterais rotomoldadas com isolamento em poliuretano<br />\r\n	injetado;</li>\r\n	<li>Tampo superior em a&ccedil;o inox escovado e faixa em a&ccedil;o inox escovado;<br />\r\n	Vidro frontal semi curvo;</li>\r\n	<li>Portas traseiras tipo bandeira;<br />\r\n	P&eacute;s regul&aacute;veis;</li>\r\n	<li>Ilumina&ccedil;&atilde;o LED.</li>\r\n</ul>\r\n\r\n<h2><strong>Refrigera&ccedil;&atilde;o:</strong></h2>\r\n\r\n<ul>\r\n	<li>Est&aacute;tica com placa fria Roll Bond com regulagem atrav&eacute;s do termostato;</li>\r\n	<li>Temperatura m&eacute;dia de funcionamento +4&ordm;C a +10&ordm;C;</li>\r\n	<li>Uma placa fria e uma grade ou duas placas frias;</li>\r\n</ul>', NULL, 4680, 'balcao-refrigerado-boreal-220v-inox-bbrc175-2-placas', '2018-06-06 11:14:55', 'A', '', '', 1, 4, 24, 79),
(28, 'Batedor de milk shake', '<h2>O&nbsp;<strong>Batedor de Milk Shake Skymsen Copo Inox 1 haste - 200W</strong>&nbsp;&eacute; perfeito para uso dom&eacute;stico ou profissional. Invente novos sabores e ouse com os card&aacute;pios requintados feito em poucos minutos. O batedor &eacute; de alta resist&ecirc;ncia, possui copo em inox e 6 meses de garantia.</h2>', NULL, 4594, 'batedor-de-milk-shake', '2018-06-06 11:20:14', 'A', '', '', 1, 6, 12, 80),
(29, 'Cafeteira profissional 2 reservatórios 6 litros', '<p>Servir um caf&eacute; com qualidade &eacute; um grande diferencial. Com a Cafeteira El&eacute;trica Marchesoni CF.4</p>\r\n\r\n<ul>\r\n	<li>622 &eacute; poss&iacute;vel atender uma grande quantidade de pessoas que se servem de uma boa x&iacute;cara de caf&eacute;. Indicada para lanchonetes de escolas e universidades, bares, restaurantes, hospitais, dentre outros. Esta cafeteira possui 2 dep&oacute;sitos, cada um com capacidade m&aacute;xima de 6 Litros. Bojos em a&ccedil;o inoxid&aacute;vel 304, que n&atilde;o contamina o alimento. Possui &oacute;timo acabamento, corpo em a&ccedil;o inoxid&aacute;vel escovado. Com exclusiva torneira horizontal, esta Cafeteira Comercial Marchesoni serve tanto para caf&eacute; quanto para leite &ndash; acompanha vareta para limpeza das torneiras. Ainda possui termostato pra controle da temperatura que vai de 20&deg; a 120 &deg;C. Qualidade aprovada pelo Inmetro.\r\n	<p>&nbsp;</p>\r\n\r\n	<ul>\r\n		<li>Bojos em a&ccedil;o inoxid&aacute;vel 304 (n&atilde;o contamina o alimento).</li>\r\n		<li>&Oacute;timo acabamento: corpo em a&ccedil;o inoxid&aacute;vel escovado.</li>\r\n		<li>Resist&ecirc;ncias blindadas de alta performance.</li>\r\n		<li>Registros manuais para entrada e sa&iacute;da de &aacute;gua.</li>\r\n		<li>Exclusiva torneira horizontal (indicada para caf&eacute; e leite).</li>\r\n		<li>Acompanha vareta para limpeza das torneiras.</li>\r\n		<li>Termostato para controle de temperatura de 20&ordm; a 120&ordm;C.</li>\r\n		<li>Certificado pelo Inmetro.</li>\r\n		<li>Capacidade: 12 litros (2 bojos de 6 litros cada).</li>\r\n		<li>Dimens&otilde;es do produto (C x L x A): 41,8 x 26,8 x 64,4 cm.</li>\r\n		<li>Consumo: 3000W / 3,00kw/h.</li>\r\n		<li>Alimenta&ccedil;&atilde;o: 220V.</li>\r\n	</ul>\r\n	</li>\r\n</ul>', NULL, 3979, 'cafeteira-profissional-2-reservatorios-6-litros', '2018-06-06 11:41:44', 'A', '', '', 1, 6, 19, 81),
(30, 'Check out  c/ kit', '<p>O Check Out Premium Amap&aacute; em formato U tem design inovador e atende &agrave; norma NR17, podendo ser montado tanto para o lado direito quanto para o esquerdo.Vers&aacute;til, possui kit automa&ccedil;&atilde;o opcional e preparo para balan&ccedil;a.Todos os produtos Amap&aacute; possuem qualidade, resist&ecirc;ncia e durabilidade garantidas pelo uso de mat&eacute;rias-primas de alto padr&atilde;o, processos produtivos com a mais atual tecnologia e um cuidado especial em cada etapa.Altura: 0,90mLargura: 1,00mComrimento: 1,85mKit automa&ccedil;&atilde;o: opcionalImagens ilustrativas. As tonalidades de cores dos produtos podem variar das visualizadas em monitores e impressos em geral.</p>', NULL, 4233, 'check-out-c-kit', '2018-06-06 11:45:08', 'A', '', '', 1, 6, 4, 82),
(31, 'Estufa curva de 12 bandejas - dupla', '<h2><strong>Detalhes do produto: Marchesoni: Estufa para Salgados 12 Bandejas Dupla Marchesoni Linha Ouro</strong></h2>\r\n\r\n<p>Vidros TEMPERADOS;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bandejas em a&ccedil;o inoxid&aacute;vel com 3 cm de altura;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Perfil/Friso dourado em pl&aacute;stico ABS;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Termostato bimet&aacute;lico regul&aacute;vel para economia de energia el&eacute;trica;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Resist&ecirc;ncia tubular de baixo consumo 150 W (0,15 Kw/h);</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Umidificador;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ideal para conservar salgados, past&eacute;is, assados em geral (esfihas, croissants, tortas, empadas).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Especifica&ccedil;&otilde;es T&eacute;cnicas</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Modelo: 2.221/222;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bandejas:&nbsp;12 Bandejas (Dupla);</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Consumo: 250 W (0,25&nbsp;Kw/h);</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Alimenta&ccedil;&atilde;o:&nbsp;127 ou 220 Volts;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Peso L&iacute;quido:&nbsp;14,6 kg;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Peso Bruto:&nbsp;16&nbsp;kg;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Certificado pelo INMETRO.</p>\r\n\r\n<p>&nbsp;</p>', NULL, 3991, 'estufa-curva-de-12-bandejas-dupla', '2018-06-06 11:50:33', 'A', '', '', 1, 6, 19, 83),
(32, 'Rótulos e etiquetas', '<p>R&oacute;tulos e etiquetas personalizadas.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Consultar pre&ccedil;o por cota&ccedil;&atilde;o.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Consultar quantidade m&iacute;nima.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Trabalhamos com etiquetas, R&oacute;tulos, Bobina PDV, Ribbon e Adesivos para identifica&ccedil;&atilde;o.&nbsp;</p>', NULL, 1, 'rotulos-e-etiquetas', '2018-06-08 16:39:31', 'A', '', '', 10, 13, 1, 84),
(33, 'Etiquetas e rótulos', '<p>Consultar quantidade minima.</p>\r\n\r\n<p>Consultar pre&ccedil;o.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Fazemos etiquetas e r&oacute;tulos personalizados.&nbsp;</p>', NULL, 2, 'etiquetas-e-rotulos', '2018-06-08 16:53:57', 'I', '', '', 10, 13, 1, 85),
(34, 'Ilha de 2 metros', '<h2><strong>Caracter&iacute;sticas</strong></h2>\r\n\r\n<p>Estrutural:</p>\r\n\r\n<ul>\r\n	<li>Gabinete monobloco com isolamento em poliuretano injetado;</li>\r\n	<li>Revestimento externo de chapa adesivada ou em a&ccedil;o inox;</li>\r\n	<li>Acabamento interno em a&ccedil;o pintado;</li>\r\n	<li>Tampas deslizantes em vidro Low E temperados de seguran&ccedil;a;</li>\r\n	<li>P&eacute;s regul&aacute;veis;</li>\r\n	<li>Inox com alta resist&ecirc;ncia a corros&atilde;o;</li>\r\n	<li>Grades ajust&aacute;veis</li>\r\n	<li>Vidro baixo emissivo</li>\r\n	<li>Tubo de cobre</li>\r\n	<li>Dupla a&ccedil;&atilde;o</li>\r\n</ul>\r\n\r\n<h2><strong>Refrigera&ccedil;&atilde;o:</strong></h2>\r\n\r\n<ul>\r\n	<li>Refrigera&ccedil;&atilde;o est&aacute;tica atrav&eacute;s de tubos de cobre;</li>\r\n	<li>Temperatura m&eacute;dia de funcionamento:</li>\r\n	<li>Resfriados: -5&ordm;C a +5&ordm;C;</li>\r\n	<li>Congelados: abaixo de -18&ordm;C;</li>\r\n	<li>Term&ocirc;metro anal&oacute;gico.</li>\r\n</ul>', NULL, 4212, 'ilha-de-2-metros', '2018-06-11 10:49:55', 'A', '', '', 1, 4, 24, 86),
(35, 'Jogo de mesas de madeira', '<h1>Compromisso com o Meio Ambiente</h1>\r\n\r\n<p>A Maplan trabalha com a produ&ccedil;&atilde;o de conjuntos de mesas e cadeiras e conjuntos de bistr&ocirc;s utilizando a madeira mista legalizada na estrutura dos produtos e o tampo das mesas utilizando a madeira Teca.</p>\r\n\r\n<p>&quot;Teca&quot; &eacute; uma &aacute;rvore de grande porte, nativa do sudoeste asi&aacute;tico. Al&eacute;m da durabilidade e estabilidade, a madeira tamb&eacute;m apresenta alta resist&ecirc;ncia ao ataque de cupins, brocas marinhas e outros insetos. Talvez por essas caracter&iacute;sticas os antigos j&aacute; a utilizassem na constru&ccedil;&atilde;o de embarca&ccedil;&otilde;es.</p>\r\n\r\n<p>A madeira &eacute; f&aacute;cil de trabalhar, extremamente est&aacute;vel, praticamente n&atilde;o empena e n&atilde;o se contrai durante a secagem. A estabilidade permite que a Teca resista a grandes varia&ccedil;&otilde;es de umidade do ambiente. A madeira &eacute; moderadamente pesada e sua utiliza&ccedil;&atilde;o concentra-se na ind&uacute;stria naval, no segmento mobili&aacute;rio e tamb&eacute;m na fabrica&ccedil;&atilde;o de alguns pisos e decks.</p>\r\n\r\n<p>A Teca cont&eacute;m uma substancia semelhante ao l&aacute;tex, denominado caucho, que reduz a absor&ccedil;&atilde;o de &aacute;gua e lubrifica as superf&iacute;cies al&eacute;m de conferir resist&ecirc;ncia a &aacute;cidos e proteger pregos e parafusos contra a corros&atilde;o.</p>', NULL, 2, 'jogo-de-mesas-de-madeira', '2018-06-16 09:30:55', 'A', '', '', 1, 11, 13, 88),
(36, 'Jogos de mesas de madeira Bistrô', '<p>A Maplan trabalha com a produ&ccedil;&atilde;o de conjuntos de mesas e cadeiras e conjuntos de bistr&ocirc;s utilizando a madeira mista legalizada na estrutura dos produtos e o tampo das mesas utilizando a madeira Teca, sendo:</p>\r\n\r\n<h1>&quot;Teca&quot;, &eacute; uma &aacute;rvore de grande porte, nativa do sudoeste asi&aacute;tico. Al&eacute;m da durabilidade e estabilidade, a madeira tamb&eacute;m apresenta alta resist&ecirc;ncia ao ataque de cupins, brocas marinhas e outros insetos. Talvez por essas caracter&iacute;sticas os antigos j&aacute; a utilizassem na constru&ccedil;&atilde;o de embarca&ccedil;&otilde;es.</h1>\r\n\r\n<p>A madeira &eacute; f&aacute;cil de trabalhar, extremamente est&aacute;vel, praticamente n&atilde;o empena e n&atilde;o se contrai durante a secagem. A estabilidade permite que a Teca resista a grandes varia&ccedil;&otilde;es de umidade do ambiente. A madeira &eacute; moderadamente pesada e sua utiliza&ccedil;&atilde;o concentra-se na ind&uacute;stria naval, no segmento mobili&aacute;rio e tamb&eacute;m na fabrica&ccedil;&atilde;o de alguns pisos e decks.</p>\r\n\r\n<p>A Teca cont&eacute;m uma substancia semelhante ao l&aacute;tex, denominado caucho, que reduz a absor&ccedil;&atilde;o de &aacute;gua e lubrifica as superf&iacute;cies al&eacute;m de conferir resist&ecirc;ncia a &aacute;cidos e proteger pregos e parafusos contra a corros&atilde;o.</p>', NULL, 3, 'jogos-de-mesas-de-madeira-bistro', '2018-06-16 09:38:43', 'A', '', '', 1, 11, 13, 89),
(37, 'Torre de chopp Marchesoni 3,5 litros', '<h2>Descri&ccedil;&atilde;o</h2>\r\n\r\n<ul>\r\n	<li>Indicada para Bares, Lanchonetes, Restaurantes e Buffets;</li>\r\n	<li>Ideal para servir a bebida gelada a manter a temperatura;</li>\r\n	<li>Pode ser utilizada com qualquer bebida;</li>\r\n	<li>Diminui a lavagem de copos;</li>\r\n	<li>Alivia o servi&ccedil;o do gar&ccedil;om dentre outras qualidades e benef&iacute;cios.&nbsp;</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>Possui sistema girat&oacute;rio para autosservi&ccedil;o;</li>\r\n	<li>Mant&eacute;m a temperatura adequada por at&eacute; 2h;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', NULL, 1164, 'torre-de-chopp-marchesoni-3-5-litros', '2018-06-16 09:46:08', 'A', '', '', 1, 4, 19, 90),
(38, 'PROMOÇÃO - Panela elétrica', '<p><strong>&nbsp;Para Cozer Arroz e Legumes:</strong><br />\r\nO modelo 6x prepara at&eacute; 6 x&iacute;caras de arroz cozido e o modelo de 10x prepara at&eacute;&nbsp; x&iacute;caras de arroz&nbsp;</p>\r\n\r\n<p><strong>&nbsp;Bandeja de Legumes:</strong><br />\r\nTanto o modelo de 10 x&iacute;caras quanto o modelo de 6 x&iacute;caras acompanham a bandeja para legumes.<br />\r\n<strong>&nbsp;Mant&eacute;m alimentos aquecidos:</strong><br />\r\nAp&oacute;s terminar o cozimento, a panela mant&eacute;m&nbsp;o arroz aquecido at&eacute; voc&ecirc; servir.<br />\r\n<strong>&nbsp;Cuba Antiaderente:</strong><br />\r\nMuito mais f&aacute;cil de limpar, os alimentos saem com muito mais facilidade.<br />\r\n<strong>&nbsp;Conjunto para a cafeteira:</strong><br />\r\n- Filtro reutiliz&aacute;vel<br />\r\n- Suporte para filtro<br />\r\n- Colher de medida<br />\r\n- Reservat&oacute;rio de &aacute;gua<br />\r\n- Cuba antiaderente<br />\r\n- Cabo de for&ccedil;a remov&iacute;vel</p>', NULL, 167121, 'promocao-panela-eletrica', '2018-09-17 14:14:58', 'A', '', '', 1, 12, 6, 91),
(39, 'PROMOÇÃO - Churrasqueira elétrica', '<p><strong>Assados deliciosos na comodidade da sua casa.</strong><br />\r\nPr&aacute;tica na hora de preparar diversas op&ccedil;&otilde;es de grelhados: carnes, aves, peixes e legumes.<br />\r\nA Churrasqueira El&eacute;trica Agratto &eacute; ideal para sua resid&ecirc;ncia.<br />\r\nCom o ajuste de temperatura e a grelha com regulagem de altura voc&ecirc; prepara diversos tipos de alimentos.</p>\r\n\r\n<p><strong>&bull; Ideal para sua resid&ecirc;ncia:</strong><br />\r\nAssa carnes, aves, peixes, legumes e muito mais.<br />\r\n<strong>&bull; F&aacute;cil e pr&aacute;tica de usar:</strong><br />\r\nBasta adicionar &aacute;gua na bandeja, ligar e escolher a temperatura.<br />\r\n<strong>&bull; N&atilde;o necessita carv&atilde;o:</strong><br />\r\nPode ser usada em diversos ambientes pois faz menos fuma&ccedil;a.<br />\r\n<strong>&bull; Regulagem de altura e temperatura:</strong><br />\r\nGrelha com regulagem de altura e termostato com ajuste de temperatura.<br />\r\n<strong>&bull; Resist&ecirc;ncia e grelha remov&iacute;veis:</strong><br />\r\nResist&ecirc;ncia e grelha podem ser removidos para facilitar a limpeza.</p>', NULL, 774434, 'promocao-churrasqueira-eletrica', '2018-09-17 14:19:42', 'A', '', '', 1, 12, 6, 92),
(40, 'PROMOÇÃO - Fogão elétrico', '<p><strong>Compacto, pr&aacute;tico, simples.</strong><br />\r\nO Fog&atilde;o El&eacute;trico de Mesa Agratto &eacute; ideal para sua cozinha.<br />\r\nPrepare as mais deliciosas receitas nesse pr&aacute;tico fog&atilde;o de mesa com dois pratos de aquecimento e ajuste de temperatura.<br />\r\nUm fog&atilde;o para completar sua cozinha.</p>\r\n\r\n<p><strong>&bull; Compacto:</strong><br />\r\nSe adequa &agrave;s sua necessidades facilitando seu uso<br />\r\n<strong>&bull; F&aacute;cil e pr&aacute;tico de usar:</strong><br />\r\nBasta ligar na tomada e colocar a panela sobre o prato de aquecimento.<br />\r\n<strong>&bull; Corpo em a&ccedil;o inoxid&aacute;vel:</strong><br />\r\nMaior resist&ecirc;ncia e facilidade na limpeza.<br />\r\n<strong>&bull; Dois pratos de aquecimento:</strong><br />\r\nFeitos em ferro fundido, aquecem mais r&aacute;pido e mant&eacute;m a temperatura.<br />\r\n<strong>&bull; Cinco n&iacute;veis de temperatura:</strong><br />\r\nEscolha um dos cinco n&iacute;veis de temperatura.<br />\r\n<strong>&bull; Todos os tipos de panelas:</strong><br />\r\nFunciona com todos os tipos de panelas do mercado que podem ser usadas para fog&otilde;es &agrave; g&aacute;s.<br />\r\n<strong>&bull; Seguran&ccedil;a e estabilidade:</strong><br />\r\nN&atilde;o precisa de g&aacute;s pois funciona com resist&ecirc;ncias el&eacute;tricas para aquecer as panelas.</p>', NULL, 744614, 'promocao-fogao-eletrico', '2018-09-17 14:23:40', 'I', '', '', 1, 12, 6, 93),
(41, 'PROMOÇÃO - Fogão elétrico', '<p><strong>Compacto, pr&aacute;tico, simples.</strong><br />\r\nO Fog&atilde;o El&eacute;trico de Mesa Agratto &eacute; ideal para sua cozinha.<br />\r\nPrepare as mais deliciosas receitas nesse pr&aacute;tico fog&atilde;o de mesa com dois pratos de aquecimento e ajuste de temperatura.<br />\r\nUm fog&atilde;o para completar sua cozinha.</p>\r\n\r\n<p><strong>&bull; Compacto:</strong><br />\r\nSe adequa &agrave;s sua necessidades facilitando seu uso<br />\r\n<strong>&bull; F&aacute;cil e pr&aacute;tico de usar:</strong><br />\r\nBasta ligar na tomada e colocar a panela sobre o prato de aquecimento.<br />\r\n<strong>&bull; Corpo em a&ccedil;o inoxid&aacute;vel:</strong><br />\r\nMaior resist&ecirc;ncia e facilidade na limpeza.<br />\r\n<strong>&bull; Dois pratos de aquecimento:</strong><br />\r\nFeitos em ferro fundido, aquecem mais r&aacute;pido e mant&eacute;m a temperatura.<br />\r\n<strong>&bull; Cinco n&iacute;veis de temperatura:</strong><br />\r\nEscolha um dos cinco n&iacute;veis de temperatura.<br />\r\n<strong>&bull; Todos os tipos de panelas:</strong><br />\r\nFunciona com todos os tipos de panelas do mercado que podem ser usadas para fog&otilde;es &agrave; g&aacute;s.<br />\r\n<strong>&bull; Seguran&ccedil;a e estabilidade:</strong><br />\r\nN&atilde;o precisa de g&aacute;s pois funciona com resist&ecirc;ncias el&eacute;tricas para aquecer as panelas.</p>', NULL, 98156, 'promocao-fogao-eletrico', '2018-09-17 14:24:39', 'A', '', '', 1, 12, 6, 94),
